scripts.fetchUserProfile:
"function(accessToken, ctx, cb) {
const jwt = require('jsonwebtoken@7.1.9');
const token = jwt.decode(ctx.id_token);
const profile = {
  email: token.email,
  name: token.name,
  user_id: token.sub,
  picture: token.picture,
  given_name: token.given_name,
  family_name: token.family_name,
  aal: token.aal,
  ial: token.ial,
  acr: token.acr || '',
  amr: token.amr || '',
  email_verified: token.email_verified,
  nickname: token.nickname,
  mfa_enabled: token.mfa_enabled
};
cb(null, profile);
}
"
